import React, { useState } from 'react';
import Papa from 'papaparse';

function App() {
  const [data, setData] = useState([]);

  const handleFileUpload = (event) => {
    const file = event.target.files[0];

    Papa.parse(file, {
      header: true,
      skipEmptyLines: true,
      complete: (result) => {
        // Получаем только первые пять столбцов
        const trimmedData = result.data.map((row) => {
          const limitedRow = {};
          const keys = Object.keys(row).slice(0, 5); // Берем первые 5 ключей (столбцов)
          keys.forEach((key) => {
            limitedRow[key] = row[key];
          });
          return limitedRow;
        });

        setData(trimmedData);
      },
    });
  };

  return (
    <div>
      <h1>CSV Upload</h1>
      <input type="file" accept=".csv" onChange={handleFileUpload} />
      <table>
        <thead>
          <tr>
            {data.length > 0 && Object.keys(data[0]).map((key) => <th key={key}>{key}</th>)}
          </tr>
        </thead>
        <tbody>
          {data.map((row, index) => (
            <tr key={index}>
              {Object.values(row).map((val, i) => <td key={i}>{val}</td>)}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default App;
